    [],nt"revision_timestamp": "2016-07-27T22:57:52.255318",nt"name": "protecting-delmarva-fox-squirrel-habitat-from-gypsy-moth-and-southern-pine-beetle-at-black",nt"isopen":
    false,nt"url": null,nt"notes": "During the summer of 1992 and 1993, United
    States Department of Agriculture Forest Service personnel conducted an inventory
    and analysis of the forested resources at Blackwater National Wildlife Refuge. The
    purpose of these activities was to provide site-specific information necessary to
    make management decisions regarding both the gypsy moth and southern pine beetle
    that currently threaten existing and potential habitat of the Delmarva Peninsula
    fox squirrel.  This report documents existing forest cover types found at Blackwater
    National Wildlife Refuge and provides management recommendations and stand hazard
    rating for both gypsy moth and southern pine beetle. This report also includes a
    rating of desirable fox squirrel habitat and silvicultural recommendations to improve
    habitat conditions, using criteria outlined in the Delmarva Peninsula Fox Squirrel
    Recovery Plan.",nt"license_title": "License Not Specified",nt"extras":
